import React from 'react';

function ProjectCard(props){
    return(
        <div>

            <h6>Project Title</h6>
            <small>[Project Dates]</small>
            <p>Skills Used</p>
            <div className = "d-inline Skills-Styling">
                <div>Skill 1</div>
                <div>Skill 2</div>
            </div>
        </div>
    );
}

export default ProjectCard;
